import React from 'react';
import Select from '../../react-select/dist/declarations/src/Select.d';

const options = [
    {
        label: 'Test1',
        value: 'test1'
    },
    {
        label: 'Test2',
        value: 'test2'
    },
    {
        label: 'Test3',
        value: 'test3'
    }
]

function Dropdown(props) {
    return (
        <div>
            <Select options={options} />
        </div>
    )
}

export default Dropdown;
